const SEARCH_DOCUMENTS = {"/#introduction":{"href":"/#introduction","heading":"Introduction","content":"Introduction This website serves to maintain internal documentation regarding Team Spiral Racing. It contains details on branding, how-to's, technical system, and much more. The items below are what is covered. Table of Contents Branding YouTube","keywords":[],"description":""},"/#table-of-contents":{"href":"/#table-of-contents","heading":"Table of Contents","content":"Table of Contents Branding YouTube","keywords":[],"description":""},"/branding/introduction#introduction-to-branding":{"href":"/branding/introduction#introduction-to-branding","heading":"Introduction to Branding","content":"Introduction to Branding Branding for Team Spiral Racing is the same as any other organization. It should remain consistent across all forms of media and platforms. This includes YouTube, Website, Social Media, and even on the cars. Logos are are provided in the following pages.","keywords":[],"description":""},"/branding/logos#logos":{"href":"/branding/logos#logos","heading":"Logos","content":"Logos This section contains information on how to modify the logos as well as listing the existing logos used. Modifiying Logos Logos and all branding material are designed in Figma. In order to work with/modify the logos, you will need to navigate to the Figma page named \" Team Spiral \". Assets full.png :   icon.png :   short-white.png :   short.png :  ","keywords":[],"description":""},"/branding/logos#modifiying-logos":{"href":"/branding/logos#modifiying-logos","heading":"Modifiying Logos","content":"Modifiying Logos Logos and all branding material are designed in Figma. In order to work with/modify the logos, you will need to navigate to the Figma page named \" Team Spiral \".","keywords":[],"description":""},"/branding/logos#assets":{"href":"/branding/logos#assets","heading":"Assets","content":"Assets full.png :   icon.png :   short-white.png :   short.png :  ","keywords":[],"description":""},"/youtube/creating-videos#creating-videos-for-youtube":{"href":"/youtube/creating-videos#creating-videos-for-youtube","heading":"Creating Videos for YouTube","content":"Creating Videos for YouTube When creating videos for YouTube, you will need to: Edit the video if necessary. Create a YouTube thumbnail. Upload to YouTube. Editing the Video Most footage on the Team Spiral Racing YouTube is Raw Footage but if you would like to cut certain parts out (like waiting at pits) then you can use the provided  videoCut  command line functionality. If you would like to anything more complicated than cutting and stitching, then it is recommended to use video editing software like Davinci Resolve or similar. videoCut If you are part of Team Spiral Racnig you can request Jonathan Lo to provide you with a  videoCut  command to make editing easier. To use: Launch terminal Open the video you want to edit (ex. GX012345.MP4) Find the start time you want (ex. 1 :32 ) Find th end time you want (ex. 4 :35 ) Run the command with the following template videoCut <filename> <start_time> <end_time>\n\n# Example\nvideoCut GX012345.MP4 132 435 The file will be cut and saved Creating a YouTube Thumbnail YouTube thumbnails are created in Figma under \" TSR Thumbnails \" page. Follow the steps below to use the existing template. Copy and paste one of the existing thumnail frames. Move it to a new line ensuring the spacing is equal to all the others. Change the name of the frame into the format  <YYYYMMDD> <Unique Name> - Run 1 . An example being  20241223 GMR Raw - Run 1 . Paste in your thumbnail picture. Ideal pictures are larger in side that can be downscaled. Resize the image to 1920 x 1080. You can do this by selecting the image, on the right under \"Layout\" unselect the \"Lock aspect ratio\" button, and typing in 1920 for W and 1080 for H. Move the image over the new frame, it should join automatically. Move the image to the bottom layer of the frame. This can be done by going to the right under \"Layers\", finding your image element and drag it down within its frame section. Delete the old image from the Layers menu. Adjust the opacity of the layer to ensure that the text shows up well against the picture. To do this, select the \"Opacity\" layer under your frame, and adjust the RGB opacity value under \"Fill\" on the right. Generally 10-20% is good. Adjust the text in the image. From top to bottom it is location, type of video, and video number in series (runs). Export the thumbnail to its highest quality size. YouTube's max size for a thumbnail is 2MB. Generally if we export it directly, we will exceed this file size which is why we need to downscale it. To do this, select your thumbnail frame and locate the \"Export\" section on the right. Use PNG format and adjust the downscale value until you find a value just below 2MB (2000 Kb). Use the value to export the rest of the thumbnail frames. Uploading to YouTube Simply drag and drop the video to the upload. Instead of filling out the the title, description, etc. Select the \"Reuse details\" button the top right. Select any of the videos. Update the title to match the context of the video. In the description add details about the event, run, etc. A nice to have is including the driver name as well as a link to the event if possible. Under playlist, create a new playlist. Follow the template of the other playlists with the title being  <Month> <Date>, <Year> <Name>  (ex.  May 24th, 2025 BW CW13 Track Day ). Add some additional information in the description similar to what you had in the video. Select \"Not for Kids\" and go to next. Schedule the upload on the next Monday that doesn't have a YouTube video already scheduled. For the rest of the videos follow the same steps. When reusing the details select the video you just created so you don;'t need to copy as much over. Just update the run number in the title. When scheduling the videos in a series it should fall on the next day. A sample upload schedule is below for a series with 3 videos. If a video series is longer than 7 videos (a week) then continue to loop it back to Monday. Monday Tuesday Wednesday Thursday Friday Run 1 Run 2 Run 3 No upload No upload","keywords":[],"description":""},"/youtube/creating-videos#editing-the-video":{"href":"/youtube/creating-videos#editing-the-video","heading":"Editing the Video","content":"Editing the Video Most footage on the Team Spiral Racing YouTube is Raw Footage but if you would like to cut certain parts out (like waiting at pits) then you can use the provided  videoCut  command line functionality. If you would like to anything more complicated than cutting and stitching, then it is recommended to use video editing software like Davinci Resolve or similar. videoCut If you are part of Team Spiral Racnig you can request Jonathan Lo to provide you with a  videoCut  command to make editing easier. To use: Launch terminal Open the video you want to edit (ex. GX012345.MP4) Find the start time you want (ex. 1 :32 ) Find th end time you want (ex. 4 :35 ) Run the command with the following template videoCut <filename> <start_time> <end_time>\n\n# Example\nvideoCut GX012345.MP4 132 435 The file will be cut and saved","keywords":[],"description":""},"/youtube/creating-videos#videocut":{"href":"/youtube/creating-videos#videocut","heading":"videoCut","content":"videoCut If you are part of Team Spiral Racnig you can request Jonathan Lo to provide you with a  videoCut  command to make editing easier. To use: Launch terminal Open the video you want to edit (ex. GX012345.MP4) Find the start time you want (ex. 1 :32 ) Find th end time you want (ex. 4 :35 ) Run the command with the following template videoCut <filename> <start_time> <end_time>\n\n# Example\nvideoCut GX012345.MP4 132 435 The file will be cut and saved","keywords":[],"description":""},"/youtube/creating-videos#creating-a-youtube-thumbnail":{"href":"/youtube/creating-videos#creating-a-youtube-thumbnail","heading":"Creating a YouTube Thumbnail","content":"Creating a YouTube Thumbnail YouTube thumbnails are created in Figma under \" TSR Thumbnails \" page. Follow the steps below to use the existing template. Copy and paste one of the existing thumnail frames. Move it to a new line ensuring the spacing is equal to all the others. Change the name of the frame into the format  <YYYYMMDD> <Unique Name> - Run 1 . An example being  20241223 GMR Raw - Run 1 . Paste in your thumbnail picture. Ideal pictures are larger in side that can be downscaled. Resize the image to 1920 x 1080. You can do this by selecting the image, on the right under \"Layout\" unselect the \"Lock aspect ratio\" button, and typing in 1920 for W and 1080 for H. Move the image over the new frame, it should join automatically. Move the image to the bottom layer of the frame. This can be done by going to the right under \"Layers\", finding your image element and drag it down within its frame section. Delete the old image from the Layers menu. Adjust the opacity of the layer to ensure that the text shows up well against the picture. To do this, select the \"Opacity\" layer under your frame, and adjust the RGB opacity value under \"Fill\" on the right. Generally 10-20% is good. Adjust the text in the image. From top to bottom it is location, type of video, and video number in series (runs). Export the thumbnail to its highest quality size. YouTube's max size for a thumbnail is 2MB. Generally if we export it directly, we will exceed this file size which is why we need to downscale it. To do this, select your thumbnail frame and locate the \"Export\" section on the right. Use PNG format and adjust the downscale value until you find a value just below 2MB (2000 Kb). Use the value to export the rest of the thumbnail frames.","keywords":[],"description":""},"/youtube/creating-videos#uploading-to-youtube":{"href":"/youtube/creating-videos#uploading-to-youtube","heading":"Uploading to YouTube","content":"Uploading to YouTube Simply drag and drop the video to the upload. Instead of filling out the the title, description, etc. Select the \"Reuse details\" button the top right. Select any of the videos. Update the title to match the context of the video. In the description add details about the event, run, etc. A nice to have is including the driver name as well as a link to the event if possible. Under playlist, create a new playlist. Follow the template of the other playlists with the title being  <Month> <Date>, <Year> <Name>  (ex.  May 24th, 2025 BW CW13 Track Day ). Add some additional information in the description similar to what you had in the video. Select \"Not for Kids\" and go to next. Schedule the upload on the next Monday that doesn't have a YouTube video already scheduled. For the rest of the videos follow the same steps. When reusing the details select the video you just created so you don;'t need to copy as much over. Just update the run number in the title. When scheduling the videos in a series it should fall on the next day. A sample upload schedule is below for a series with 3 videos. If a video series is longer than 7 videos (a week) then continue to loop it back to Monday. Monday Tuesday Wednesday Thursday Friday Run 1 Run 2 Run 3 No upload No upload","keywords":[],"description":""},"/youtube/inroduction#introduction-to-youtube":{"href":"/youtube/inroduction#introduction-to-youtube","heading":"Introduction to YouTube","content":"Introduction to YouTube YouTube is the primary format of sharing content. The videos mostly contain Raw Footage videos, though there are plans to expand that eventually. Videos on the  Team Spiral Racing  YouTube Channel are ideally in 4K format with a minumum of 1080p.","keywords":[],"description":""},"#hyperbook":{"href":"#hyperbook","heading":"Hyperbook","content":"Hyperbook A great tool for building interactive workbooks. See the  hyperbook\ndocumentation  for more\ndetails.","keywords":[],"description":""}};
